import React, {Component} from 'react'
import './style.css'

class List extends Component{
  constructor(props){
    super(props)

  }
  toggleComplated = (index)=>{
    this.props.toggleComplated(index)
  }
  render(){
    return (
      <ul className="list">
        {
          this.props.list.map((el,index)=>{
            return(
              <li key={index}>
                <i className={el.status === 0?'quan':'complated'} onClick={this.toggleComplated(index)}></i>
                <p>{el.context}</p>
                <em className='del'>X</em>
              </li>
            )
          })
        }
      </ul>
    )
  }
}

export default List
